import React from 'react';
import "../App.css"

const Users = (props) => {
  const {user,setUser} = props
  return(
    <form>
      <div>
        User Name:
      </div>
      <input
        type="Text"
        value={user}       
      />
      <button
        onClick={setUser}
      >
        Submit
      </button>
    </form>
  )
}
